CREATE PROCEDURE [Staging].[sp_Load_Customers]
AS
BEGIN
    SET NOCOUNT ON;

    TRUNCATE TABLE [Staging].[stg_Customers];

    INSERT INTO [Staging].[stg_Customers]
    SELECT CustomerID, CustomerName, Email, Phone, Region
    FROM [Sales].[Customers]
    WHERE IsActive = 1;
END

CREATE PROCEDURE [Staging].[sp_Load_Products]
AS
BEGIN
    SET NOCOUNT ON;

    TRUNCATE TABLE [Staging].[stg_Products];

    INSERT INTO [Staging].[stg_Products]
    SELECT ProductID, ProductName, Category, Price, Cost
    FROM [Sales].[Products];
END

CREATE FUNCTION [dbo].[fn_Calculate_Discount](@CustomerID INT, @OrderAmount DECIMAL(18,2))
RETURNS DECIMAL(5,2)
AS
BEGIN
    DECLARE @Discount DECIMAL(5,2) = 0;

    IF @OrderAmount > 1000 SET @Discount = @Discount + 5;
    IF @OrderAmount > 5000 SET @Discount = @Discount + 5;

    IF EXISTS (SELECT 1 FROM [Analytics].[Dim_Customer] WHERE CustomerID = @CustomerID AND TotalOrders > 10)
        SET @Discount = @Discount + 3;

    RETURN @Discount;
END
